import logo from "./logo.svg";
import "./App.css";
import { useState } from "react";
import Header from "./Header";
function App() {
  const [name, setName] = useState("vinish");
  function NameChange() {
    const names = ["Vini", "Jeni"];
    const int = Math.floor(Math.random() * 2);
    setName(names[int]);
  }

  return (
    <div className="App">
      <Header />
    </div>
  );
}

export default App;
